import React from 'react'
import ProgressBar from "./ProgressBar"
import "./skills.scss"

export default function SkillsSection() {

  const languages = [
    {"label": "Python", "percentage": "80"},
    {"label": "Django", "percentage": "70"},
    {"label": "JavaScript", "percentage": "80"},
    {"label": "Node.js", "percentage": "60"},
    {"label": "React", "percentage": "80"},
    {"label": "Redux", "percentage": "60"},
    {"label": "PostgreSQL", "percentage": "50"},
  ]

  const education = [
    {
      "souce": "MRGN",
      "title": "Full Stack Developer",
      "date": "Jun 2021",
      "description": "Present",
      "bullets": [
        "Contribute in the development of a full stack financial application using the latest technologies and frameworks.",
        "Create features utilizing React/Redux, Node.js, and AWS.",
        "Give personal insight on feature creation and development.",
        "Work closely with all teams in the development process to help deliver tasks in timely manner.",
      ]
    },
  ]

  return (
    <section id="skills" className="skills">
      <h2 className="header-text">Skills</h2>
      <div className="section-content">
        <div className="bar-container">
          {languages.map((language, index) => (
            <ProgressBar
              key={index}
              label={language.label}
              percent={language.percentage}
            />
          ))}
        </div>
        <h2 className="header-text">Education/Certification</h2>
        <div className="education-container">
          {education.map(course => (
            <div className="course-container">
              <h3 className="course-source">{course.source}</h3>
              <h4 className="course-title">{course.title}</h4>
              <h5 className="course-date">{course.date}</h5>
              <p className="course-description">{course.description}</p>
              {course.bullets.map(bullet => (
                <p className="course-bullet">{bullet}</p>
              ))}
              <img className="course-pic" alt="course-pic"/>
            </div>
          ))}
        </div>
      </div>
    </section>
  )
}
